define({"topics" : [{"title":"Creating a new user-defined setting","shortdesc":"\n                  <p class=\"shortdesc\">User-defined settings are a useful way of passing information to your test modules         prior to startup to get them to\n                     behave in a certain way. You can create these settings         within <span class=\"ph\">TestArchitect Client</span> for either a client-directed test run or         to generate a test run batch file.\n                  </p>\n               ","id":"task_edk_5w5_3t","href":"TA_Automation\/Topics\/aut_defining_user_defined_settings.html","menu": {"hasChildren":false,},"tocID":"task_edk_5w5_3t-d46e26763","topics":[]},{"title":"Creating a startup setting for a built-in setting","shortdesc":"\n                  <p class=\"shortdesc\">In addition to being modifiable from within your test procedures, built-in settings         can have their values set by you\n                     just prior to the launch of your test run.         \n                  </p>\n               ","id":"task_rwr_hh3_jt","href":"TA_Automation\/Topics\/aut_configuring_built_in_settings.html","menu": {"hasChildren":false,},"tocID":"task_rwr_hh3_jt-d46e26777","topics":[]},{"title":"Editing an existing startup setting","shortdesc":"\n                  <p class=\"shortdesc\">You can edit the startup attributes of existing user-defined and built-in         settings.</p>\n               ","id":"task_tk5_lxc_jt","href":"TA_Automation\/Topics\/aut_editing_user_defined_settings.html","menu": {"hasChildren":false,},"tocID":"task_tk5_lxc_jt-d46e26788","topics":[]},{"title":"Deleting a startup setting","shortdesc":"\n                  <p class=\"shortdesc\">You can delete startup settings of both user-defined and built-in         settings.</p>\n               ","id":"task_ljl_vxc_jt","href":"TA_Automation\/Topics\/aut_removing_user_defined_settings.html","menu": {"hasChildren":false,},"tocID":"task_ljl_vxc_jt-d46e26799","topics":[]}]});